\begin{tikzpicture}[scale=0.1]
  % Define coordinates for the outer rectangle
  \coordinate (A) at (0,0);
  \coordinate (B) at (30,0);
  \coordinate (C) at (30,30);
  \coordinate (D) at (0,30);

  % Define coordinates for the top notch (10x10 cutout)
  \coordinate (E) at (10,30);
  \coordinate (F) at (10,20);
  \coordinate (G) at (20,20);
  \coordinate (H) at (20,30);

  % Define coordinates for the right notch (10x10 cutout)
  \coordinate (I) at (30,20);
  \coordinate (J) at (20,20);
  \coordinate (K) at (20,10);
  \coordinate (L) at (30,10);

  % Draw the outer shape
  \draw[thick] (A) -- (B) -- (I) -- (K) -- (J) -- (G) -- (H) -- (D) -- cycle;

  % Draw the notches (inner lines)
  \draw[thick] (E) -- (F);
  \draw[thick] (F) -- (G);
  \draw[thick] (J) -- (K);
  \draw[thick] (K) -- (L);

  % Labels for dimensions
  \node[above] at (15,30) {10};
  \node[right] at (30,15) {10};
  \node[below] at (15,0) {30};
  \node[left] at (0,15) {30};

\end{tikzpicture}
